    data: |
      SELECT DISTINCT + ( 6 ) - + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( col0 ) + + + col0 + - + 77 * - 51 IS NULL;
  - name: tab1

outputs:
